- request:
    body: '{"input": ["\fHICKORY DICKORY DOCK Hickory, dickory, dock The mouse ran
      up the clock. The clock struck one The mouse ran down Hickory, dickory, dock.
      Hickory, dickory, dock The mouse ran up the clock. The clock struck two And
      down he flew Hickory, dickory, dock.", "\fHEY DIDDLE DIDDLE Hey diddle diddle,
      the cat and the fiddle The cow jumped over the moon The little dog laughed to
      see such fun And the dish ran away with the spoon! Hey diddle diddle, the cat
      and the fiddle The cow jumped over the moon The little dog laughed to see such
      fun And the dish ran away with the spoon!", "\fHOT CROSS BUNS Hot cross buns!
      Hot cross buns! One a penny, two a penny. Hot cross buns! If you have no daughters,
      Give them to your sons! One a penny, two a penny. Hot cross buns!", "\fJACK
      & JILL Jack and Jill went up a hill, To fetch a pail of water; Jack fell down
      and broke his crown, And Jill came tumbling after.", "\fMUFFIN MAN Oh, do you
      know the muffin man, The muffin man, the muffin man? Oh, do you know the muffin
      man, Who lives on Dury lane? Oh, yes we know the muffin man, The muffin man,
      the muffin man. Oh, yes we know the muffin man, Who lives on Dury lane.", "\fLITTLE
      MISS MUFFET Little Miss Muffet sat on her tuffet Eating her curds and whey Along
      came a spider Sat down beside her And frightened Miss Muffet away.", "\fBAA
      BAA BLACK SHEEP Baa, baa, black sheep, have you any wool? Yes, sir, yes, sir,
      three bags full. One for my master, one for my dame, And one for the little
      boy who lives down the lane. Baa, baa, black sheep have you any wool? Yes, sir,
      yes, sir, three bags full.", "\fHUMPTY DUMPTY Humpty Dumpty sat on a wall. Humpty
      Dumpty had a great fall. All the king''s horses and all the King''s men Could
      not put Humpty together again.", "\fONE, TWO, BUCKLE MY SHOE One, two Buckle
      my shoe, Three, four Open on the door, Five, six Pick up sticks, Seven, eight
      Lay them straight, Nine, ten A good fat hen,", "Eleven, twelve Dig and delve,
      Thirteen, fourteen Maids a-courting, Fifteen, sixteen Maids in the kitchen,
      Seventeen, eighteen Maids a-waiting, Nineteen, twenty My plate''s empty.", "\fOLD
      MOTHER HUBBARD Old Mother Hubbard Went to the cupboard To get her poor dog a
      bone. When she got there The cupborad was bare So the poor little dog had none.",
      "\fLITTLE BOY BLUE Little boy blue come blow up your horn. The sheep''s in the
      meadow, The cow''s in the corn. But where is the boy who looks after the sheep?
      He''s under the haystack, Fast asleep.", "\fPETER PETER PUMPKIN EATER Peter
      Peter pumpkin eater, Had a wife and couldn''t keep her! He put her in a pumpkin
      shell, And there he kept her very well!", "\fJACK BE NIMBLE Jack be nimble,
      Jack be quick, Jack jump over The candlestick.", "\fLITTLE BO PEEP Little Bo-Peep
      has lost her sheep, And can''t tell where to find them; Leave them alone, and
      they''ll come home, And bring their tails behind them.", "\fDIDDLE DIDDLE DUMPLING
      Diddle diddle dumpling, my son John Went to bed with his breeches on; One sock
      off, and one sock on, Diddle diddle dumpling, my son John.", "\fLITTLE JACK
      HORNER Little Jack Horner sat in the corner Eating his Christmas pie, He put
      in his thumb and pulled out a plum And said \"What a good boy am I!\"", "\fOLD
      KING COLE Old King Cole was a merry old soul, and a merry old soul was he; He
      called for his pipe in the middle of the night And he called for his fiddlers
      three. Every fiddler had a fine fiddle, and a very fine fiddle had he; Oh there''s
      none so rare as can compare With King Cole and his fiddlers three.", "\fMARY
      MARY QUITE CONTRARY Mary Mary quite contrary, How does your garden grow? With
      silver bells and cockle shells And pretty maids all in a row.", "\fGEORGIE PORGIE
      PUDDING PIE Georgie porgie pudding pie, Kissed the girls and made them cry.
      When the boys came out to play, Georgie porgie ran away.", "\fSING A SONG OF
      SIXPENCE Sing a song of sixpence a pocket full of rye, Four and twenty blackbirds
      baked in a pie. When the pie was opened the birds began to sing, Oh wasn''t
      that a dainty dish to set before the king? The king was in his counting house
      counting out his money, The queen was in the parlour eating bread and honey
      The maid was in the garden hanging out the clothes, When down came a blackbird
      and pecked off her nose!", "\fTISKET, A TASKET A tisket, a tasket, a green and
      yellow basket. I wrote a letter to my love, and on the way I lost it, I lost
      it, I lost it, And on the way I lost it. A little boy picked it up, And put
      it in his pocket, his pocket, his pocket, he put it in his pocket.", "\fA HUNTING
      WE WILL GO Oh a-hunting we will go, A-hunting we will go, We''ll catch a little
      fox, And put him in a box And then we''ll let him go", "\fLONDON BRIDGE London
      Bridge is falling down, Falling down, Falling down. London Bridge is falling
      down, My fair lady.", "\fMARY HAD A LITTLE LAMB Mary had a little lamb, little
      lamb, little lamb, Mary had a little lamb, its fleece was white as snow. And
      everywhere that Mary went, Mary went, Mary went, and everywhere that Mary went,
      the lamb was sure to go. It followed her to school one day school one day, school
      one day, It followed her to school one day, which was against the rules. It
      made the children laugh and play, laugh and play, laugh and play, it made the
      children laugh and play to see", "a lamb at school. And so the teacher turned
      it out, turned it out, turned it out, And so the teacher turned it out, but
      still it lingered near, And waited patiently about, patiently about, patiently
      about, And waited patiently about till Mary did appear. \"Why does the lamb
      love Mary so?\" Love Mary so? Love Mary so? \"Why does the lamb love Mary so,\"
      the eager children cry. \"Why, Mary loves the lamb, you know.\" The lamb, you
      know, the lamb, you know, \"Why, Mary loves the lamb, you know,\" the teacher
      did reply.", "\fRAIN RAIN GO AWAY Rain, rain, go away, Come again another day
      Rain, rain, go away, Little (Bobby) wants to play.", "\fLITTLE BUNNY FOO FOO
      Little Bunny Foo Foo, Hoping through the forest, Scooping up the field mice,
      And Bopping'' ''em on the head. (Spoken) And down came the good fairy and she
      said: \"Little Bunny Foo Foo, I don''t want to see you Scooping up the field
      mice And Bopping'' ''em on the head. I''ll give you three chances, And if you
      don''t behave", "I''ll turn you into a GOON! The next day same as before except
      Two chances... One chance... Last verse say: ''Little Bunny Foo Foo, I gave
      you three chances, POOF Now your a GOON!''", "\fI\u2019M A LITTLE ACORN BROWN
      I''m a little acorn brown, Lying on the cold, hard ground, Some one came and
      stepped on me, Now I''m as as cracked as I can be. I''m a nut. (Clap, clap)
      I''m a nut. (Clap, clap)", "\fTHIS LITTLE PIGGY This Little Piggy, went to market
      This Little Piggy, stayed home This Little Piggy, had roast beef This Little
      Piggy, had none But this little Piggy, cried wee wee wee All the way home",
      "\fLAVENDAR\u2019S BLUE Lavender''s blue, dilly dilly, lavender''s green, When
      I am king, dilly, dilly, you shall be queen. ourselves warm. Who told you so,
      dilly, dilly, who told you Lavender''s green, dilly, dilly, Lavender''s so?
      blue, ''Twas my own heart, dilly, dilly, that told me If you love me, dilly,
      dilly, I will love you. so. Let the birds sing, dilly, dilly, And the lambs
      Call up your men, dilly, dilly, set them to play; work We shall be safe, dilly,
      dilly, out of harm''s Some with a rake, dilly, dilly, some with a way. fork.
      I love to dance, dilly, dilly, I love to sing; Some to make hay, dilly, dilly,
      some to When I am queen, dilly, dilly, You''ll be my thresh corn. king. While
      you and I, dilly, dilly, keep Who told me so, dilly, dilly, Who told me so?
      I told myself, dilly, dilly, I told me so.", "\fFUZZY WUZZY Fuzzy Wuzzy was
      a bear Fuzzy Wuzzy had no hair! Fuzzy Wuzzy Wasn\u2019t very fuzzy was he?",
      "\fDO YOUR EARS HANG LOW Do your ears hang low? Do they wobble to and fro? Can
      you tie them in a knot? Can you tie them in a bow? Can you throw them o''er
      your shoulder like a Continental Soldier? Do your ears hang low? Does your tongue
      hang down? Does it flop all around? Can you tie it in a knot? Can you tie it
      in a bow? Can you throw it o''er your shoulder like a Continental Soldier? Does
      your tongue hang down? Does your nose hang low? Does it wiggle to and fro? Can
      you tie it in a knot? Can you tie it in a bow? Can you throw it o''er your shoulder
      like a Continental Soldier? Does your nose hang low? Do your eyes pop out? Do
      they bounce all about? Can you tie them in a knot? Can you tie them in a bow?
      Can you throw them o''er your shoulder like a Continental Soldier? Do your eyes
      pop out?", "\fHUSH LITTLE BABY Hush, little baby, don''t say a word, Mama''s
      going to buy you a mockingbird. If that mockingbird won''t sing, Mama''s going
      to buy you a diamond ring. If that diamond ring turns brass, Mama''s going to
      buy you a looking glass. If that looking glass gets broke, Mama''s going to
      buy you a billy goat. If that dog named Rover won''t bark, Mama''s going to
      buy you a horse and cart. If that horse and cart fall down, You''ll still be
      the sweetest little boy in town.", "If that billy goat won''t pull, Mama''s
      going to buy you a cart & bull. If that cart and bull turn over, Mama''s going
      to buy you a dog named Rover. So hush little baby, don''t you cry, Daddy loves
      you and so do I.", "\f3 LITTLE KITTENS Listen to the song, Kittens and Mittens.
      Ask the children questions about the song (What did the kittens lose? Who found
      the mittens? Where were the mittens?). Using Kittens and Mittens, create movements
      to go with each section of the song. The minor section should have some type
      of ponderous, heavy movement and the chorus needs light and gentle movements.
      Have children act out the story.", "from http://www.thelittlebeethovens.com/2012/01/three-little-kittens.html",
      "\fTHIS OLD MAN This old man, he played one, He played knickknack on my thumb
      With a knickknack patty whack, give a dog a bone This old man came rolling home
      This old man, he played two, He played knickknack on my shoe With a knickknack
      patty whack, give the dog a bone", "This old man came rolling home ...three...on
      my knee... ...four...on my door... ...five...on my hive... ...six...on my sticks...
      ...seven...up to heaven... ...eight...on my gate... ...nine...all the time...
      ...ten...once again...", "\fTHREE BLIND MICE Three blind mice, three blind mice
      See how they run, see how they run They all ran after the farmer''s wife She
      cut off their tails with a carving knife Did ever see such a sight in your life
      As three blind mice", "\fBROTHER JOHN Are you sleeping, are you sleeping, Brother
      John, brother John Morning bells are ringing, Morning bells are ringing, Ding-dang-dong,
      ding-dang-dong.", "\fITSY BITSY SPIDER The Itsy Bitsy spider climbed up the
      water spout Down came the rain and washed the spider out Out came the sun and
      dried up all the rain and the Itsy Bitsy spider went up the spout again!", "\fI
      HEAR THUNDER Tune of Where is Thumbkin?", "I hear thunder! I hear thunder! Oh!
      don''t you? Oh! don''t you? Pitter, patter raindrops, Pitter, patter raindrops,
      I''m wet through! I''m wet through !", "\fTWINKLE TWINKLE LITTLE STAR Twinkle
      twinkle little star, how I wonder what you are Up above the world so high, like
      a diamond in the sky Twinkle twinkle little star, how I wonder what you are!",
      "\fTHREE JELLY FISH Three jelly fish, Three jelly fish, Three jelly fish sitting
      on a rock. One jumped off! Splash! Two jelly fish\u2026 One jelly fish\u2026
      One jelly fish\u2026 Two jelly fish\u2026 No jelly fish, Three jelly fish\u2026
      No jelly fish, No jelly fish sitting on a rock. One climbed up! Horray! Optional
      \u2013 make finger/stick puppets or felt board pieces", "\fOPEN SHUT THEM Open,
      shut them, open shut them, give a little clap. Open, shut them, open shut them,
      put them in your lap. Creep them, crawl them, creep them, crawl them, Right
      up to your chin. Open wide your little mouth, But do not let them in!", "Creep
      them, crawl them, creep them, crawl them, Right down to your toes. Let them
      fly up in the air and, Bop you on the nose. Open, shut them, open shut them,
      give a little clap. Open, shut them, open shut them, put them in your lap.",
      "\f5 GREEN & SPECKLED FROGS Optional \u2013 make finger/stick puppets or felt
      board pieces", "Five green and speckled frogs, Sat on a mossy log, Eating some
      most delicious bugs. Yum! Yum! One jumped into the pool, Where it was nice and
      cool, Now there are four green speckled frogs!", "\f5 LITTLE LADYBUGS Five little
      ladybugs climbing up a door One flew away then there were four Four little ladybugs
      sitting on a tree One flew away then there were three Three little ladybugs
      landed on a shoe One flew away then there were two Two little ladybugs looking
      for some fun One flew away and then there was one One little ladybug sitting
      in the sun She flew away and then there were none. Optional \u2013 make finger/stick
      puppets or felt board pieces", "\fGRANDMOTHER\u2019S GLASSES Recite this first
      verse of this chant in a high-pitched voice: These are Grandma''s glasses. Make
      \"glasses\" over eyes with fingers. This is Grandma''s hat. Place hands close
      together over head. And this is the way she folds her hands Clasp hands together.
      And lays them in her lap. Place hands in lap. Recite this second verse in a
      deep, low voice: These are Grandpa''s glasses. Make \"glasses\" over eyes with
      fingers. This is Grandpa''s hat. Place hands farther apart over head. And this
      is the way he folds his arms Cross arms. And takes a little nap. Place head
      on arms, as if sleeping.", "\fTHE LITTLE TURTLE I had a little turtle. Cup your
      hand slightly to make a shell. He lived inside a box. Cover the shell with your
      other hand. He swam in the water. Move both arms as if swimming. He climbed
      on the rocks. Move arms as if climbing. He snapped at a mosquito. Make a snapping
      motion with one hand. He snapped at a flea. Snap again.", "He snapped at a minnow.
      Snap again. And he snapped at me. Snap again. He caught the mosquito. Snatch
      the imaginary bug and eat it. He caught the flea. Same as above. He caught the
      minnow. Again. But he didn''t catch me. Shake your head and wag your finger.",
      "\fAPPLE TREE Way up high in the apple tree Stretch both arms above your head,
      hands open. Two little apples smiled at me Keep arms above head, close hands
      into fists. I shook that tree as hard as I could Keep arms above head, \"shake\"
      tree. Down came the apples Bring fists down toward stomach. Mmmm, they were
      good! Rub stomach.", "\fGROUNDHOG Sung to the tune of \"I''m a Little Teapot\".
      Can use with stick puppets. I''m a little groundhog Furry and brown I''m popping
      up to look around Squat and jump up. If I see my shadow down I go Look around
      with their hand over their eyes. 6 more weeks of winter..... Hold up number
      of fingers. Oh No! Hand to forehead.", "\fI WIGGLE I wiggle my fingers Wiggle
      fingers. I wiggle my toes Wiggle toes or feet. I wiggle my shoulders Shrug shoulders.
      I wiggle my nose Scrunch nose. Now the wiggles are out of me And I am as still
      as still can be Sit still.", "\fFIVE LITTLE MONKEYS Five little monkeys swinging
      on a tree Fingers extended swing your hand back and forth. Teasing Mr. Alligator,
      \"can''t catch me, can''t catch me Shaking your head, wag your finger like you''re
      saying \"no, no\". Along came Mr. Alligator quiet as can be and Say this in
      a whisper, making a SSSHHH motion. SNAP! Clap hands together like the mouth
      of an alligator. Four little monkeys swinging on a tree... Three little monkeys
      swinging on a tree... Two little monkeys swinging on a tree... One little monkey
      swinging on a tree...", "\fIF YOU\u2019RE WEARING RED TODAY Tune: Muffin Man
      If you''re wearing red today, Red today, red today, If you''re wearing red today,
      Stand up and say \"Hoo-ray!\" Repeat: for other colors", "\fTWO LITTLE FEET
      Two little feet go stamp, stamp, stamp stamp Two little hands go clap, clap,
      clap clap One little body stands up straight stand straight One little body
      goes round and round turn One little body sits quietly down. Sit", "\fHICKETY
      PICKETY BUMBLEBEE Hickety pickety bumblebee, Who can say their name for me?
      Hold up name card. That child says name.", "Whisper name with distinct syllables.",
      "Class Repeat. No sound. Clap it. Clap syllables in name. Mouth name. Snap it.
      Snap syllables. Whisper it.", "Continue holding up name cards and clapping,
      snapping, and whispering.", "\fHERE IS A BUNNY Here is a bunny with ears so
      funny Make bunny ears with finger. Here is a hold in the ground Make a circle
      with other hand. When a noise he hears, he picks up his ears Make bunny ears
      perk up. And jumps in the hole in the ground Put bunny ears into \u201chole\u201d.",
      "\fTWO LITTLE BLACKBIRDS Two little black birds Sitting on the wall, Hold up
      one finger of each hand One named Peter, The other named Paul. Fly away Peter!
      Put a hand behind your back Fly away, Paul! Put the other hand behind you back.
      Come back, Peter! Bring the first hand from behind your back. Come back, Paul!
      Bring the second hand from behind your back.", "\fWHERE IS THUMBKIN? Where is
      Thumbkin? Where is Thumbkin? Here I am, Hear I am; How are you today sir? Very
      well I thank you, Run away. Run away. Where is Pointer?... Where is Tall man?...
      Where is Ring man?... Where is Pinkie?... Where is the whole family?...", "\fCOLOR
      MOVEMENT Red.... you put your hands on your head Blue...you put your hands on
      your shoe Green...your going to wash your face clean (pretend to wash face)
      Pink....your going to think, think, think (tap pointer finger against side of
      head as if thinking) Yellow...your going to wave to a fellow (wave to a friend)",
      "Purple...make 2 little circles (with both pointer fingers make circles in the
      air) Brown....your going to turn yourself around & sit right down! from: http://www.earlylearningactivities.com/PDF/musicmovement.pdf",
      "\fTHE COOKIE JAR Group : (Tony) Stole the cookie from the cookie jar Child
      : Who ME? Group : Yes YOU! Child : Couldn''t be. Group : Then WHO? Child : (Kristi).
      Group : (Kristi) Stole the cookie from the cookie Jar Child : Who ME?... Make
      a fake cookie out of paper & laminate or craft foam & puffy paints to pass while
      saying the rhyme."], "model": "text-embedding-ada-002", "encoding_format": "base64"}'
